import React from 'react';
import Booklist from "./components/Booklist";
import { BrowserRouter, Route, Link } from 'react-router-dom';

const App = () => {
  const languages = ['React', 'Anguler', 'Vue'];
  const getDataFromAPI = keyword => {
    return `${keyword} books`
  }
  return (
    <BrowserRouter>
      <div>
        <ul>
          <li><Link to='/'>React</Link></li>
          <li><Link to='/vue'>Vue</Link></li>
          <li><Link to='/angular'>angular</Link></li>
        </ul>
        <h1>react app</h1>
        <Route
          exact
          path="/"
          render={(props) => <Booklist languages={languages[0]} getData={keyword => getDataFromAPI(keyword)} />}
        />
        <Route
          path="/vue"
          render={(props) => <Booklist languages={languages[2]} />}
        />
        <Route
          path="/angular"
          render={(props) => <Booklist languages={languages[1]} />}
        />
      </div>
    </BrowserRouter>
  );
}

export default App;
